function changeColor() {

    let colors = [
        ["#ffd416ff", "#fff5d8ff"],
        ["#069187ff", "#83fcf4ff"]
    ];
    const style = window.getComputedStyle(document.body);
    const currentColor = style.getPropertyValue("--accent-font");
    console.log(colors);
    for (let i = 0; i < colors.length; i ++) {
        if (colors[i][0] === currentColor) {
            colors.splice(i, 1);
            break;
        }
    }
    const number = Math.floor(Math.random() * (colors.length - 1));
    root.style.setProperty("--accent-font", colors[number][0]);
    root.style.setProperty("--hover-links", colors[number][1]);

    storage.setItem("--accent-font", colors[number][0]);
    storage.setItem("--hover-links", colors[number][1]);

}

const root = document.documentElement;
const storage = window.localStorage;
const accent = storage.getItem("--accent-font");
const hover = storage.getItem("--hover-links");

setInterval(changeColor, 5000);

if (accent !== null && hover !== null) {
    root.style.setProperty("--accent-font", accent);
    root.style.setProperty("--hover-links", hover);
}

